available_function_keys = {"activate_deactivate", "activate", "deactivate", "legit_unreal", "legit", "unreal"}

function ActivateDeactivate()
	activated = not activated
	if activated then
		OutputLogMessage("Script activated\n")
	else
		OutputLogMessage("Script deactivated\n")
	end
end

function Activate()
	activated = true
	OutputLogMessage("Script activated\n")
end

function Deactivate()
	activated = false
	OutputLogMessage("Script deactivated\n")
end

function LegitUnreal()
	legit = not legit
	if legit then
		OutputLogMessage("Legit Mode\n")
	else
		OutputLogMessage("Unreal Mode\n")
	end
end

function Legit()
	legit = true
	OutputLogMessage("Legit Mode\n")
end

function Unreal()
	legit = false
	OutputLogMessage("Unreal Mode\n")
end

function ExecFunction(func_key)
	--OutputLogMessage("Executing Function: %s\n", func_key)
	if func_key == "activate_deactivate" then
		ActivateDeactivate()
	elseif func_key == "activate" then
		Activate()
	elseif func_key == "deactivate" then
		Deactivate()
	elseif func_key == "legit_unreal" then
		LegitUnreal()
	elseif func_key == "legit" then
		Legit()
	elseif func_key == "unreal" then
		Unreal()
	end
end

function GetFactor(zoom_factor_bare)
	zoom_factor = 1 / zoom_factor_bare

	fov = fov_base

	attachments = attachment_options[selected_attachment]

	-- no attachemnts means default weapon zoom factor needs to be applied
	if (#selected_attachments == 0) then
		fov = fov * zoom_factor
	end

	if (ListContains(selected_attachments, "holo")) then
		fov = fov * holo
	end

	if (ListContains(selected_attachments, "8x")) then
		fov = fov * eightex
	end

	factor = (fov / 666.66666) * sens 

	return factor
end 


function GetAdjusts()

	attachments = attachment_options[selected_attachment]

	x_adjust = 1
	y_adjust = 1

	if (legit) then
		
		x_negative = math.random(0, 1)
		y_negative = math.random(0, 1)

		if (y_negative == 1) then
			y_adjust = (100 - legit_percentage) / 100
		else
			y_adjust = (100 - legit_percentage) / 100
		end
	end

	if (ListContains(selected_attachments, "silencer") or ListContains(selected_attachments, "8x")) then
		x_adjust = x_adjust * 0.8
		y_adjust = y_adjust * 0.8
	end

	return x_adjust, y_adjust
end


function FullAutoRecoil(start_ms, option)

	-- needed for calcing the diff to move
	last_position = {0, 0}

	recoil_graph = recoil_graphs_auto[option[1]]

	factor = GetFactor(option[2])

	x_adjust, y_adjust = GetAdjusts(option[2])
	
	-- pixel pool, the amount of non full pixels that are left over after using closest_int
	x_px_pool = 0
	y_px_pool = 0
	repeat
    	-- values work based on a recoil graph that contains the recoil 
    	-- for each millisecond	
		passed_ms = GetRunningTime() - start_ms

		position = recoil_graph[passed_ms + MS_ADJUST]
		if(position ~= nil and IsMouseButtonPressed(3)) then
			
			crouched = IsModifierPressed("ctrl") and option[3]

    		-- how much we should move raw
			now_move_y = position[2] - last_position[2]


			-- calculate pixel to move
			move_y_px = (now_move_y / factor) * y_adjust

			if crouched then
				move_y_px = move_y_px / 2
			end

			-- add left over pixel from previous iteration
			move_y_px = move_y_px + y_px_pool
	    		
			-- floor it 
			move_y_px_floored = closest_int(move_y_px)

			-- get left over pixel once again
			y_px_pool = move_y_px - move_y_px_floored

			-- update the total that we moved
			last_position[2] = position[2]

			-- same for x
			now_move_x = position[1] - last_position[1]

			move_x_px = (now_move_x / factor) * x_adjust

			if crouched then
				move_x_px = move_x_px / 2
			end

			move_x_px = move_x_px + x_px_pool

			move_x_px_floored = closest_int(move_x_px)

			x_px_pool = move_x_px - move_x_px_floored

			last_position[1] = position[1]

			-- adjust recoil
			MoveMouseRelative(-move_x_px_floored, -move_y_px_floored)
		end
		Sleep(1)
	until not IsMouseButtonPressed(1)
end

-- also activates the script
function ExecWeaponBind(v)
	activated = true
	selected_weapon = GetIndex(weapon_options , v)
	--OutputLogMessage("Selected Weapon: %s\n", weapon_options[selected_weapon][1])
end

function ExecAttachmentBind(v)
	table.insert(selected_attachments, v)
	--OutputLogMessage("Attachment: %s\n", v)
end

function GetIndex(values, key) 
	local index={}
	for k,v in pairs(values) do
	   index[v[1]]=k
	end
	return index[key]
end

function ExecuteBind(bindValue)
	--OutputLogMessage("bindValue: %s\n", bindValue)
	if bindValue == nil then
		return
	end

	-- clear selected_attachments	
	for k in pairs(selected_attachments) do
    	selected_attachments[k] = nil
	end

	local split = {}
	for i in bindValue:gmatch("([^, ]+)") do
		OutputLogMessage("%s\n", i)
		split[#split + 1] = i
	end

	for i, v in ipairs(split) do
		if SetContains(recoil_graphs_auto, v) then
			ExecWeaponBind(v)
		elseif ListContains(attachment_options, v) then
			ExecAttachmentBind(v)
		elseif ListContains(available_function_keys, v) then
			ExecFunction(v)
		end
	end

	print_info()
end


function ListContains (tab, val)
    for index, value in ipairs(tab) do
        if value == val then
            return true
        end
    end

    return false
end

function SetContains(set, key)
    return set[key] ~= nil
end

function BindMapping(event, arg)
	alt_down = IsModifierPressed("alt")
    shift_down = IsModifierPressed("shift")

    --OutputLogMessage("alt_down: %s, shift_down: %s, arg: %d\n", tostring(alt_down), tostring(shift_down), arg)

	if (event == "MOUSE_BUTTON_PRESSED" and arg == 3) then
		if alt_down then
			ExecuteBind(MB3_ALT)
		elseif shift_down then
			ExecuteBind(MB3_SHIFT)
		else
			ExecuteBind(MB3)
		end
	end


	if (event == "MOUSE_BUTTON_PRESSED" and arg == 4) then
		if alt_down then
			ExecuteBind(MB4_ALT)
		elseif shift_down then
			ExecuteBind(MB4_SHIFT)
		else
			ExecuteBind(MB4)
		end
	end

	if (event == "MOUSE_BUTTON_PRESSED" and arg == 5) then
		if alt_down then
			ExecuteBind(MB5_ALT)
		elseif shift_down then
			ExecuteBind(MB5_SHIFT)
		else
			ExecuteBind(MB5)
		end
	end

	if (event == "MOUSE_BUTTON_PRESSED" and arg == 6) then
		if alt_down then
			ExecuteBind(MB6_ALT)
		elseif shift_down then
			ExecuteBind(MB6_SHIFT)
		else
			ExecuteBind(MB6)
		end
	end

	if (event == "MOUSE_BUTTON_PRESSED" and arg == 7) then
		if alt_down then
			ExecuteBind(MB7_ALT)
		elseif shift_down then
			ExecuteBind(MB7_SHIFT)
		else
			ExecuteBind(MB7)
		end
	end

	if (event == "MOUSE_BUTTON_PRESSED" and arg == 8) then
		if alt_down then
			ExecuteBind(MB8_ALT)
		elseif shift_down then
			ExecuteBind(MB8_SHIFT)
		else
			ExecuteBind(MB8)
		end
	end

end

function OnEvent(event, arg)

	-- fire script on main mouse button
	if (event == "MOUSE_BUTTON_PRESSED" and arg == 1 and activated) then

		start_ms = GetRunningTime()

		weapon_option = weapon_options[selected_weapon]

		FullAutoRecoil(start_ms, weapon_option)

    elseif (event == "PROFILE_ACTIVATED") then
    	-- enable trigger onevent when mb1 is pressed
        EnablePrimaryMouseButtonEvents(true)
        print_info()
    else
		BindMapping(event, arg)
    end 

    if show_pressed_mouse_button then
    	OutputLogMessage("Pressed mouse button: %d\n", arg)
    end
end

function print_info() 
	OutputLogMessage("\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n")
	mode = "unreal"
	if(legit) then
		mode = "legit"
	end

	OutputLogMessage("Weapon: %s, Mode: %s, Activated: %s\n", weapon_options[selected_weapon][1], mode, tostring(activated))

    OutputLogMessage("Attachments:\n")
	for index, attachment in ipairs(selected_attachments) do
		OutputLogMessage("-%s\n", attachment)
	end
	
end


function closest_int(val)
	if val > 0 then
		return math.floor(val)
	else
		return math.ceil(val)
	end
end

